Dear Junior Doctors who are leaving 
@NewhamHospital
 today - thank you from the bottom of my heart for everything you’ve given us over the past year. You have been amazing, inspiring, refreshing colleagues and we’ve been lucky to have you. Good luck in your future careers /1

